import "./HomePage.css";

function HomePage() {
  return (
    <>
      <div>
        <h1>MBTI</h1>
        <h2>
          빙고로 알아보는 나의 <span>진짜!</span> MBTI
        </h2>
        <button>시작하기</button>
        {/* <Link>시작하기</Link> */}
      </div>
    </>
  );
}

export default HomePage;
